import "./ExpenseItem.css";
const ExpenseItem = function () {
  return (
    <div>
      <div className="expense-item">Jan 30th 2023</div>
      <div className="expense-item_description">Insurance</div>
      <div>3000 INR</div>
    </div>
  );
};

export default ExpenseItem;
